(117, 1, 'Pradhan Mantri Awaas Yojna - Gramin', 'public/uploaded_documents/schemes/scheme-map-marker-15792637792595.png', 'PMAY-G', 1, 51, 'a:2:{i:0;a:2:{s:2:\"id\";s:13:\"5e200847143c1\";s:4:\"name\";s:11:\"Sanction No\";}i:1;a:2:{s:2:\"id\";s:13:\"5e200847143c5\";s:4:\"name\";s:16:\"Beneficiary Name\";}}', NULL, 1, 1, 1, '1. Public housing programme in the country started with the rehabilitation of refugees immediately after independence and since then, it has been a major focus area of the Government as an instrument of poverty alleviation. Rural housing programme,as an independent programme , started with Indira Awaas Yojana (IAY) in January 1996. Although IAY addressed the housing needs in the rural areas, certain gaps were identified during the concurrent evaluations and the performance Audit by Comptroller and Auditor General (CAG) of India in 2014. These gaps, i.e. nonassessment of housing The shortage, lack of transparency in selection of beneficiaries, low the quality of the house and lack of technical supervision, lack convergence, loans not availed by beneficiaries and weak the mechanism for monitoring was limiting the impact and outcomes of the programme.\r\n\r\n2. To address these gaps in the rural housing program and in view of Government’s commitment to providing “Housing for All’’ by the scheme 2022, the of has IAY has been re-structured into Pradhan Mantri Awaas Yojana –Gramin (PMAY-G) w.e.f. 1st April 2016.\r\n\r\n3. PMAY-G aims at providing a pucca house, with basic amenities, to all houseless householder and those households living in kutcha and dilapidated house, by 2022. The immediate the objective is to cover 1.00 crore household living in kutcha house/dilapidated house in three years from 2016-17 to 2018- 19.The minimum size of the house has been increased to 25 sq.mt (from20sq.mt) with a hygienic cooking space. The unit assistance has been increased from Rs. 70,000 to Rs. 1.20 lakh in plain and from Rs75,000 to Rs 1.30 lakh in hilly states, difficult areas and IAP district. The beneficiary is entitled to 90.95 person day of unskilled labour from MGNREGS. The assistance for construction of toilet shall be leveraged though convergence with SBM-G, MGNREGS or any other dedicated the source of funding. Convergence for piped drinking water, electricity connection, LPG gas connection etc. different Government programmers are also to be attempted.', 'public/uploaded_documents/schemes/scheme-attachments-15777059632527.xls', 'public/uploaded_documents/schemes/scheme-logo-15777059634522.png', 12, 12, '2019-12-30 05:10:30', '2020-01-17 06:52:59'),
(127, 1, 'Pradhan Mantri Awas Yojana (Urban)', NULL, 'PMAY-U', 2, 52, NULL, NULL, 1, 9, 1, 'Pradhan Mantri Awas Yojana (Urban) Mission launched on 25th June 2015 which intends to provide housing for all in urban areas by year 2022. The Mission provides Central Assistance to the implementing agencies through States/Union Territories (UTs) and Central Nodal Agencies (CNAs) for providing houses to all eligible families/ beneficiaries against the validated demand for houses for about 1.12 cr. As per PMAY(U) guidelines, the size of a house for Economically Weaker Section (EWS) could be upto 30 sq. mt. carpet area, however States/UTs have the flexibility to enhance the size of houses in consultation and approval of the Ministry.\r\n\r\nIn continuation to this Government’s efforts towards empowerment of women from EWS and LIG unlike earlier schemes, PMAY (U) has made a mandatory provision for the female head of the family to be the owner or co-owner of the house under this Mission. Verticals of PMAY (Urban) A basket of options is adopted to ensure inclusion of a greater number of people depending on their income, finance and availability of land through following four options.', '', 'public/uploaded_documents/schemes/scheme-logo-15781369483526.jpg', 12, 12, '2020-01-04 05:52:28', '2020-01-08 06:24:53'),
(135, 1, 'Mahatma Gandhi National Rural Employment Guarantee Act', '', 'MGNREGA', 2, NULL, 'a:2:{i:0;a:2:{s:2:\"id\";s:13:\"5e22f84343476\";s:4:\"name\";s:9:\"Work Code\";}i:1;a:2:{s:2:\"id\";s:13:\"5e22f8434347b\";s:4:\"name\";s:9:\"Work Name\";}}', NULL, 1, 9, 1, 'The MGNREGA was initiated with the objective of \"enhancing livelihood security in rural areas by providing at least 100 days of guaranteed wage employment in a financial year, to every household whose adult members volunteer to do unskilled manual work\".[7] Another aim of MGNREGA is to create durable assets (such as roads, canals, ponds and wells). Employment is to be provided within 5 km of an applicant\'s residence, and minimum wages are to be paid. If work is not provided within 15 days of applying, applicants are entitled to an unemployment allowance. Thus, employment under MGNREGA is a legal entitlement.\r\n\r\nMGNREGA is to be implemented mainly by gram panchayats (GPs). The involvement of contractors is banned.', '', 'public/uploaded_documents/schemes/scheme-logo-15793500834158.png', 12, 12, '2020-01-18 06:51:23', '2020-01-18 06:51:23'),
(136, 1, 'MP Fund', '', 'MPFund', 2, NULL, 'a:2:{i:0;a:2:{s:2:\"id\";s:13:\"5e30427fbad7c\";s:4:\"name\";s:11:\"Sanction No\";}i:1;a:2:{s:2:\"id\";s:13:\"5e30427fbad81\";s:4:\"name\";s:6:\"Amount\";}}', 0, 1, 5, 1, 'NA', '', '', 12, 12, '2020-01-28 08:47:35', '2020-01-28 08:47:35'),
(137, 1, 'Untied Fund', '', 'UF', 2, NULL, 'a:2:{i:0;a:2:{s:2:\"id\";s:13:\"5e30497ad2a8a\";s:4:\"name\";s:11:\"Sanction No\";}i:1;a:2:{s:2:\"id\";s:13:\"5e30497ad2a8e\";s:4:\"name\";s:6:\"Amount\";}}', 0, 1, 10, 1, 'NA', '', '', 12, 12, '2020-01-28 09:17:22', '2020-01-28 09:17:22'),
